# <h2>Game Loop</h2>
while True:

    # <p><span style="background-color: rgb(251, 238, 184);">CH</span>:
    #     Excellent explanation. Very clear what you're doing here, and a nice
    #     and elegant solution for this problem. The "key insight" is pretty
    #     simple, but that's not a bad thing, and you lay it out
    #     well.<br><br>The<strong> max_h</strong> and <strong>i_val</strong>
    #     variables are placeholder variables. These values get updated as the
    #     while loop progresses. There are 8 mountains the ship has to destroy,
    #     and the for loop has an index that accounts for this. The current
    #     mountain height is stored as the <strong>mountain_h</strong> variable
    #     and is then checked against the current max height. If it stays the
    #     max height, it is then passed to the print statement for the ship to
    #     target and destroy that mountain.&nbsp;</p>
    # <p><span style="background-color: rgb(251, 238, 184);">CH</span>: I would
    #     maybe rename "i_val" to something like "best_i" or "best_index", but
    #     it's pretty clear what it is already.</p>
    # <p><span style="background-color: rgb(194, 224, 244);">ACF</span>: Keeping
    #     i_val as it is just the variable for the current index.</p>
    max_h = 0 # maximum height per pass
    i_val = 0 # index value of mountain

    # <p>get all mountain heights per pass of ship</p>
    for i in range(8):
        mountain_h = int(input())  # represents the height of one mountain.

        # <p>if statement to check if each mountain is tallest</p>
        if mountain_h > max_h:
            max_h = mountain_h # store max height
            i_val = i # store index

    # <p>Write an action using print To debug: print("Debug messages...",
    #     file=sys.stderr, flush=True)</p>

    # <h3>Output</h3>
    # <p>The index of the mountain to fire on.</p>
    # <p><span style="background-color: rgb(251, 238, 184);">CH</span>: Overall,
    #     really well documented. I would only have added a blurb at the top to
    #     explain the premise of the game, so that it makes sense. I followed
    #     the link, so I figured it out, I would just add something like "You're
    #     piloting a ship and shooting at mountains to make them shorter. You
    #     have to shoot at the tallest mountain each turn"</p>
    print(i_val)
    
    
    
